const categoryMappings = {};

function modifyCategoryLink(category, url) {
  categoryMappings[category.toLowerCase()] = url;
  processAllLinks(); 
}

function processLink(anchor) {
  const span = anchor.querySelector('span');
  if (!span) return;

  const label = span.textContent?.trim().toLowerCase();
  if (!label) return;
  const targetUrl = categoryMappings[label];
  if (!targetUrl) return;

  if (anchor.dataset.modifiedLabel === label && anchor.dataset.modifiedUrl === targetUrl) {
    return;
  }

  anchor.href = targetUrl;
  anchor.dataset.modifiedLabel = label;
  anchor.dataset.modifiedUrl = targetUrl;

  const newAnchor = anchor.cloneNode(true);
  anchor.replaceWith(newAnchor);

  newAnchor.addEventListener('click', function (e) {
    const isSameOrigin = (function () {
      try {
        const u = new URL(targetUrl, location.href);
        return u.origin === location.origin;
      } catch {
        return false;
      }
    })();

    if (isSameOrigin) {
      if (window.next && window.next.router && typeof window.next.router.push === 'function') {
        e.preventDefault();
        window.next.router.push(targetUrl);
        return;
      }
      // else biarkan default navigation
    } else {
      // external link: paksa redirect
      e.preventDefault();
      window.location.href = targetUrl;
    }
  });
}

let debounceTimer = null;
function processAllLinks() {
  if (debounceTimer) clearTimeout(debounceTimer);
  debounceTimer = window.setTimeout(() => {
    const anchors = Array.from(document.querySelectorAll('.swiper-slide a'));
    anchors.forEach(processLink);
  }, 100);
}

const observer = new MutationObserver((mutations) => {
  let shouldRun = false;
  for (const m of mutations) {
    if (m.addedNodes.length > 0) {
      shouldRun = true;
      break;
    }
  }
  if (shouldRun) processAllLinks();
});

observer.observe(document.body, {
  childList: true,
  subtree: true,
});

if (document.readyState === 'loading') {
  document.addEventListener('DOMContentLoaded', processAllLinks);
} else {
  processAllLinks();
}
window.addEventListener('load', processAllLinks);

(function attachNextRouterListener() {
  if (window.next && window.next.router && window.next.router.events) {
    window.next.router.events.on('routeChangeComplete', processAllLinks);
  } else {
    setTimeout(attachNextRouterListener, 500);
  }
})();

